import React from 'react';

const LogoutPage = () => {
  return (
    <div className="content">
      <div className="logout-message">
        <h2>Successfully Logged Out</h2>
        {/* You can add additional content or styling here */}
      </div>
    </div>
  );
};

export default LogoutPage;
